import React from "react";
import './UserProfileRating.css'
import { Col } from "react-bootstrap";
const UserProfileRating = (props) => {
    return(
        <Col style={{border:'2px solid black'}}  md={3}>
          <div className="rating__label">Rating: {props.rating}</div>
          <div className="main-wrapper__profile">
            <div className="badge1 custom">
              <div className="circle"><FontAwesomeIcon icon={faUserCircle}/></div>
            </div>
          </div>
        </Col>
    )
}

export default UserProfileRating;
